import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import StaffListScreen from './StaffListScreen'; // Adjust the import path
import StaffDetailsScreen from './StaffDetailsScreen'; // Adjust the import path
import AddUpdateStaffScreen from './AddUpdateStaffScreen'; // Adjust the import path

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="StaffList">
        <Stack.Screen name="StaffList" component={StaffListScreen} />
        <Stack.Screen name="StaffDetails" component={StaffDetailsScreen} />
        <Stack.Screen name="AddUpdateStaff" component={AddUpdateStaffScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
